import React from "react";
import { Menu, Segment, Container, Grid, Header } from "semantic-ui-react";

export default () => {
  return (
    <div style={{ position: "" }}>
      <Segment
        inverted
        style={{
          margin: "",
          padding: "10%,10%,10%,10%",
          position: "absolute",
          width: "100%",
          height: "20%",
          bottom: "0",
        }}
        vertical
      >
        <Container>
          <Grid columns={4} stackable inverted divided>
            <Grid.Row>
              <Grid.Column>
                <Header as="h4" content="About" />
              </Grid.Column>
            </Grid.Row>
          </Grid>
        </Container>
      </Segment>
    </div>
  );
};
